Вот улучшенная версия функции с более информативным названием и добавлением возвращаемого значения:
```swift
/// Сортирует массив целых чисел в порядке возрастания.
///
/// - Parameter числа: Массив целых чисел для сортировки.
/// - Returns: Отсортированный массив целых чисел.
func sortArray(_ numbers: [Int]) -> [Int] {
    let sortedArray = numbers.sorted()
    return sortedArray
}

// Пример использования:
let numbers = [5, 2, 8, 1, 9]
let sortedNumbers = sortArray(numbers)
print(sortedNumbers)
```
В этом примере функция `sortArray` принимает массив целых чисел, сортирует его с помощью метода `sorted()` и возвращает отсортированный массив. Это позволяет использовать результат функции в дальнейшем коде.

Если вы хотите сортировать массив в порядке убывания, вы можете использовать ключ `by` в методе `sorted()`:
```swift
func sortArrayDescending(_ numbers: [Int]) -> [Int] {
    let sortedArray = numbers.sorted(by: { $0 > $1 })
    return sortedArray
}

// Пример использования:
let numbers = [5, 2, 8, 1, 9]
let sortedNumbers = sortArrayDescending(numbers)
print(sortedNumbers)
```
В этом примере функция `sortArrayDescending` сортирует массив в порядке убывания, используя ключ `by` с обратной логикой сравнения.

Aquí te muestro un ejemplo de código en C++ para ESP32 que utiliza la biblioteca `OneWire` y `DallasTemperature` para leer la temperatura de los sensores DS18B20 y mostrarla por el monitor serial.

Primero, debes instalar las bibliotecas `OneWire` y `DallasTemperature` en tu proyecto ESP32. Puedes hacerlo siguiendo estos pasos:

1. Abre el IDE de Arduino y selecciona "Sketch" > "Bibliotecas" > "Administrar bibliotecas...".
2. Busca "OneWire" y selecciona "Instalar".
3. Busca "DallasTemperature" y selecciona "Instalar".

Ahora, aquí te muestro el código:

```cpp
#include <WiFi.h>
#include <OneWire.h>
#include <DallasTemperature.h>

// Definir la dirección del sensor DS18B20
const int pinDS18B20 = 2;  // Puedes cambiar a cualquier pin digital

// Definir la red Wi-Fi
const char* ssid = "tu_red_wifi";
const char* password = "tu_contraseña_wifi";

// Definir la instancia de la clase OneWire
OneWire oneWire(pinDS18B20);

// Definir la instancia de la clase DallasTemperature
DallasTemperature sensors(&oneWire);

void setup() {
  Serial.begin(115200);
  delay(100);

  // Conectar a la red Wi-Fi
  WiFi.begin(ssid, password);
  while (WiFi.status()!= WL_CONNECTED) {
    delay(1000);
    Serial.println("Conectando a la red Wi-Fi...");
  }
  Serial.println("Conectado a la red Wi-Fi");

  // Inicializar la instancia de la clase DallasTemperature
  sensors.begin();
}

void loop() {
  // Leer la temperatura de los sensores DS18B20
  sensors.requestTemperatures();
  float temperatura = sensors.getTempCByIndex(0);

  // Mostrar la temperatura por el monitor serial
  Serial.print("Temperatura: ");
  Serial.print(temperatura);
  Serial.println("°C");

  // Esperar 1 segundo antes de leer la temperatura nuevamente
  delay(1000);
}
```

En este código, debes reemplazar `tu_red_wifi` y `tu_contraseña_wifi` con la red Wi-Fi a la que deseas conectarte y la contraseña correspondiente.

El código utiliza la biblioteca `OneWire` para comunicarse con el sensor DS18B20 y la biblioteca `DallasTemperature` para leer la temperatura. La función `requestTemperatures()` le pide a la instancia de la clase `DallasTemperature` que lea la temperatura de los sensores conectados. La función `getTempCByIndex(0)` devuelve la temperatura en grados Celsius del primer sensor conectado.

Recuerda que debes conectar el sensor DS18B20 a la pin digital definida en la variable `pinDS18B20` y que el sensor debe estar configurado en el modo de búsqueda de dispositivos (pull-up en el pin de datos).

