Això es coneix com a "bloqueig de pantalla" o "bloqueig de pantalla de pantalla" i es produeix quan l'usuari toca el botó d'atracar o realitza una acció que la tanqui. Aquesta funcionalitat està disponible en molts sistemes operatius mòbils, incloent Android i iOS.

**Motius per a la pantalla de bloqueig**

Hi ha diverses raons per les quals una aplicació pot bloquejar la pantalla quan es toca el botó d'atracar o es realitza una acció que la tanqui:

1. **Seguretat**: Per evitar que l'usuari accedeixi a la pantalla de la aplicació quan no està actiu.
2. **Economia de bateria**: Per reduir la consum de bateria quan l'usuari no està utilitzant la aplicació.
3. **Millora de la velocitat**: Per evitar que la pantalla de la aplicació es mostri quan no és necessari, millorant la velocitat de la resposta de la pantalla.

**Com implementar la pantalla de bloqueig**

Per implementar la pantalla de bloqueig en una aplicació mòbil, cal utilitzar les següents etapes:

1. **Crear un layout de bloqueig**: Crea un layout que es mostrarà quan la pantalla de la aplicació estigui bloquejada.
2. **Configurar el botó d'atracar**: Configura el botó d'atracar per que, quan es toqui, es bloqueï la pantalla de la aplicació.
3. **Configurar les accions de bloqueig**: Configura les accions que faran que la pantalla de la aplicació es bloqueï, com ara la sortida de la pantalla de la aplicació.
4. **Implementar la lògica de bloqueig**: Implementa la lògica per a bloquejar la pantalla de la aplicació quan es compleixin les condicions establertes.

**Exemple d'implementació en Android**

A continuació, es mostra un exemple d'implementació de la pantalla de bloqueig en Android:
```java
// Crear un layout de bloqueig
public class BlockScreenLayout extends LinearLayout {
    public BlockScreenLayout(Context context) {
        super(context);
        // Configurar el layout
        setOrientation(LinearLayout.VERTICAL);
        // Afegir un botó per desbloquejar la pantalla
        Button desbloquejarButton = new Button(context);
        desbloquejarButton.setText("Desbloquejar");
        addView(desbloquejarButton);
    }
}

// Configurar el botó d'atracar
public class MainActivity extends AppCompatActivity {
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        // Configurar el botó d'atracar
        getWindow().setOnKeyLongPressListener(new View.OnKeyLongPressListener() {
            @Override
            public void onKeyLongPress(View v, long keyCode, KeyEvent event) {
                // Bloquejar la pantalla de la aplicació
                getWindow().setFlags(WindowManager.LayoutParams.FLAG_NOT_TOUCHABLE, WindowManager.LayoutParams.FLAG_NOT_TOUCHABLE);
            }
        });
    }
}

// Configurar les accions de bloqueig
public class MainActivity extends AppCompatActivity {
    @Override
    protected void onDestroy() {
        super.onDestroy();
        // Bloquejar la pantalla de la aplicació quan es tanqui
        getWindow().setFlags(WindowManager.LayoutParams.FLAG_NOT_TOUCHABLE, WindowManager.LayoutParams.FLAG_NOT_TOUCHABLE);
    }
}

// Implementar la lògica de bloqueig
public class MainActivity extends AppCompatActivity {
    @Override
    protected void onResume() {
        super.onResume();
        // Comprovar si la pantalla de la aplicació està bloquejada
        if (getWindow().getFlags() == WindowManager.LayoutParams.FLAG_NOT_TOUCHABLE) {
            // Mostrar el layout de bloqueig
            BlockScreenLayout blockScreenLayout = new BlockScreenLayout(this);
            setContentView(blockScreenLayout);
        }
    }
}
```
Aquest és un exemple bàsic d'implementació de la pantalla de bloqueig en Android. Cal tenir en compte que la implementació real depèn de les necessitats específiques de la seva aplicació.

Un "if" en Java es una estructura de control de flujo que permite ejecutar un bloque de código si se cumple una condición específica. A continuación, te muestro un ejemplo básico de cómo se utiliza un "if" en Java:

```java
public class EjemploIf {
    public static void main(String[] args) {
        int edad = 25;

        if (edad >= 18) {
            System.out.println("Eres mayor de edad");
        } else {
            System.out.println("Eres menor de edad");
        }
    }
}
```

En este ejemplo, la variable `edad` se compara con el valor 18. Si la edad es mayor o igual a 18, se imprime "Eres mayor de edad". Si no se cumple la condición, se imprime "Eres menor de edad".

También se pueden utilizar "if" anidados, es decir, un "if" dentro de otro "if". Por ejemplo:

```java
public class EjemploIfAnidado {
    public static void main(String[] args) {
        int edad = 25;
        int sexo = 1; // 1 para hombre, 2 para mujer

        if (edad >= 18) {
            if (sexo == 1) {
                System.out.println("Eres un hombre mayor de edad");
            } else {
                System.out.println("Eres una mujer mayor de edad");
            }
        } else {
            System.out.println("Eres menor de edad");
        }
    }
}
```

También se pueden utilizar "if" con múltiples condiciones, utilizando el operador "&&" (y lógico) o "||" (o lógico). Por ejemplo:

```java
public class EjemploIfConMúltiplesCondiciones {
    public static void main(String[] args) {
        int edad = 25;
        int sexo = 1; // 1 para hombre, 2 para mujer

        if (edad >= 18 && sexo == 1) {
            System.out.println("Eres un hombre mayor de edad");
        } else if (edad >= 18 && sexo == 2) {
            System.out.println("Eres una mujer mayor de edad");
        } else {
            System.out.println("Eres menor de edad");
        }
    }
}
```

También se pueden utilizar "if" con condiciones que involucran variables booleanas. Por ejemplo:

```java
public class EjemploIfConVariablesBooleanas {
    public static void main(String[] args) {
        boolean esMayorDeEdad = true;
        boolean esHombre = true;

        if (esMayorDeEdad && esHombre) {
            System.out.println("Eres un hombre mayor de edad");
        } else if (esMayorDeEdad &&!esHombre) {
            System.out.println("Eres una mujer mayor de edad");
        } else {
            System.out.println("Eres menor de edad");
        }
    }
}
```

En resumen, el "if" en Java es una estructura de control de flujo que permite ejecutar un bloque de código si se cumple una condición específica. Puede ser utilizado de manera individual, anidado, con múltiples condiciones y con variables booleanas.

The function `checkPrime` is a good start, but it can be improved in a few ways. Here's a refactored version:

```javascript
/**
 * Checks for prime numbers in an array of numbers.
 * 
 * @param {number[]} numbers - The array of numbers to check.
 */
function checkPrime(numbers) {
    function isPrime(num) {
        if (num <= 1) return false;
        for (let i = 2, sqrt = Math.sqrt(num); i <= sqrt; i++) {
            if (num % i === 0) return false;
        }
        return true;
    }

    numbers.forEach(num => {
        if (isPrime(num)) console.log(num);
    });
}

// Example usage:
checkPrime([1, 2, 3, 4, 5]);
```

Changes made:

1. Added a JSDoc comment to describe the function and its parameter.
2. Used `forEach` instead of a `for...of` loop to iterate over the array. This is a more concise and expressive way to iterate over arrays in JavaScript.
3. Calculated `Math.sqrt(num)` only once and stored it in a variable `sqrt` to avoid repeated calculations.

However, this function still has a time complexity of O(n*sqrt(n)) due to the nested loop. We can improve this to O(n*sqrt(n)) by using the Sieve of Eratosthenes algorithm to generate prime numbers up to the maximum number in the input array.

Here's an improved version:

```javascript
/**
 * Checks for prime numbers in an array of numbers.
 * 
 * @param {number[]} numbers - The array of numbers to check.
 */
function checkPrime(numbers) {
    function sieveOfEratosthenes(max) {
        const sieve = new Array(max + 1).fill(true);
        sieve[0] = sieve[1] = false;
        for (let i = 2; i <= Math.sqrt(max); i++) {
            if (sieve[i]) {
                for (let j = i * i; j <= max; j += i) {
                    sieve[j] = false;
                }
            }
        }
        return sieve;
    }

    const max = Math.max(...numbers);
    const primes = sieveOfEratosthenes(max);
    numbers.forEach(num => {
        if (primes[num]) console.log(num);
    });
}

// Example usage:
checkPrime([1, 2, 3, 4, 5]);
```

This version has a time complexity of O(n + sqrt(max)), where max is the maximum number in the input array.

